import React, {useEffect} from 'react';
import { useDispatch } from 'react-redux';
import Page from "./page";
import './Home.css';
import ListCrypto from '../components/ListCrypto';
import {fetchInfoCurrency} from "./currencySlice";

const Home = () => {
	const dispatch = useDispatch();
	useEffect(()=>{
		console.log('s');
		dispatch(fetchInfoCurrency());
	},[]);

	return (
		<Page>
			<h1>Home</h1>

			<div>
				<ListCrypto/>
			</div>
		</Page>
	);
};

export default Home;
